{"strNational":null,"strProfessional":"","strInternational":"","strEvents":"<\/ul> <h3>\u0414\u043e XIX \u0432\u0435\u043a\u0430 <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1565_%D0%B3%D0%BE%D0%B4\" title=\"1565 \u0433\u043e\u0434\">1565<\/a>&#160;\u2014 \u041e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BD%D1%82-%D0%9E%D0%B3%D0%B0%D1%81%D1%82%D0%B8%D0%BD_(%D0%A4%D0%BB%D0%BE%D1%80%D0%B8%D0%B4%D0%B0)\" class=\"mw-redirect\" title=\"\u0421\u0435\u043d\u0442-\u041e\u0433\u0430\u0441\u0442\u0438\u043d (\u0424\u043b\u043e\u0440\u0438\u0434\u0430)\">\u0421\u0430\u043d-\u0410\u0433\u043e\u0441\u0442\u0438\u043d<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D1%80%D0%B8%D0%B4%D0%B0\" title=\"\u0424\u043b\u043e\u0440\u0438\u0434\u0430\">\u0424\u043b\u043e\u0440\u0438\u0434\u0430<\/a>), \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u043e\u0435 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0\" title=\"\u0415\u0432\u0440\u043e\u043f\u0430\">\u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0446\u0435\u0432<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1609_%D0%B3%D0%BE%D0%B4\" title=\"1609 \u0433\u043e\u0434\">1609<\/a>&#160;\u2014 \u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043c\u043e\u0440\u0435\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%B4%D0%B7%D0%BE%D0%BD,_%D0%93%D0%B5%D0%BD%D1%80%D0%B8\" title=\"\u0413\u0443\u0434\u0437\u043e\u043d, \u0413\u0435\u043d\u0440\u0438\">\u0413. \u0413\u0443\u0434\u0437\u043e\u043d<\/a> \u043e\u0442\u043a\u0440\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BB%D0%B0%D0%B2%D1%8D%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2\" class=\"mw-redirect\" title=\"\u0414\u0435\u043b\u0430\u0432\u044d\u0440\u0441\u043a\u0438\u0439 \u0437\u0430\u043b\u0438\u0432\">\u0437\u0430\u043b\u0438\u0432 \u0414\u0435\u043b\u0430\u0432\u044d\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1697_%D0%B3%D0%BE%D0%B4\" title=\"1697 \u0433\u043e\u0434\">1697<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0451\u0442\u0440 I<\/a> \u043f\u0440\u0438\u0431\u044b\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BD%D1%81%D1%82%D0%B0%D0%B4\" title=\"\u0417\u0430\u043d\u0441\u0442\u0430\u0434\">\u0417\u0430\u0430\u043d\u0434\u0430\u043c<\/a> (\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0438\u044f)<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1735_%D0%B3%D0%BE%D0%B4\" title=\"1735 \u0433\u043e\u0434\">1735<\/a>&#160;\u2014 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0-%D0%B1%D0%B0%D0%BB%D0%B5%D1%82\" title=\"\u041e\u043f\u0435\u0440\u0430-\u0431\u0430\u043b\u0435\u0442\">\u043e\u043f\u0435\u0440\u044b-\u0431\u0430\u043b\u0435\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%BB%D0%B0%D0%BD%D1%82%D0%BD%D0%B0%D1%8F_%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0413\u0430\u043b\u0430\u043d\u0442\u043d\u0430\u044f \u0418\u043d\u0434\u0438\u044f\">\u00ab\u0413\u0430\u043b\u0430\u043d\u0442\u043d\u0430\u044f \u0418\u043d\u0434\u0438\u044f\u00bb<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%BC%D0%BE,_%D0%96%D0%B0%D0%BD-%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF\" title=\"\u0420\u0430\u043c\u043e, \u0416\u0430\u043d-\u0424\u0438\u043b\u0438\u043f\u043f\">\u0416.-\u0424.\u0420\u0430\u043c\u043e<\/a>, \u0432\u043e \u0412\u0442\u043e\u0440\u043e\u0439 \u0440\u0435\u0434\u0430\u043a\u0446\u0438\u0438: \u0432 \u0442\u0440\u0451\u0445 \u0432\u044b\u0445\u043e\u0434\u0430\u0445 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D0%BB%D0%BE%D0%B3\" class=\"mw-disambig\" title=\"\u041f\u0440\u043e\u043b\u043e\u0433\">\u043f\u0440\u043e\u043b\u043e\u0433\u043e\u043c<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D0%B8%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0\" class=\"mw-redirect\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u043f\u0430\u0440\u0438\u0436\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\">\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0430\u044f \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u043c\u0443\u0437\u044b\u043a\u0438<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1739_%D0%B3%D0%BE%D0%B4\" title=\"1739 \u0433\u043e\u0434\">1739<\/a>&#160;\u2014 \u041f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D0%BE%D0%B4_%D0%A1%D1%82%D0%B0%D0%B2%D1%83%D1%87%D0%B0%D0%BD%D0%B0%D0%BC%D0%B8\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u043e\u0434 \u0421\u0442\u0430\u0432\u0443\u0447\u0430\u043d\u0430\u043c\u0438\">\u0431\u0438\u0442\u0432\u0435 \u043f\u043e\u0434 \u0421\u0442\u0430\u0432\u0443\u0447\u0430\u043d\u0430\u043c\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 \u0423\u0438\u043b\u044c\u044f\u043c \u0413\u0435\u0440\u0448\u0435\u043b\u044c \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BD%D1%86%D0%B5%D0%BB%D0%B0%D0%B4_(%D1%81%D0%BF%D1%83%D1%82%D0%BD%D0%B8%D0%BA)\" title=\"\u042d\u043d\u0446\u0435\u043b\u0430\u0434 (\u0441\u043f\u0443\u0442\u043d\u0438\u043a)\">\u042d\u043d\u0446\u0435\u043b\u0430\u0434<\/a>, \u0441\u043f\u0443\u0442\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%82%D1%83%D1%80%D0%BD\" title=\"\u0421\u0430\u0442\u0443\u0440\u043d\">\u0421\u0430\u0442\u0443\u0440\u043d\u0430<\/a>.<\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XIX_%D0%B2%D0%B5%D0%BA\" title=\"XIX \u0432\u0435\u043a\">XIX \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1842_%D0%B3%D0%BE%D0%B4\" title=\"1842 \u0433\u043e\u0434\">1842<\/a>&#160;\u2014 \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%83%D0%BF%D0%BD%D0%B5%D0%B9%D1%88%D0%B8%D0%B5_%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D0%BA%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D1%8B_XIX_%D0%B2%D0%B5%D0%BA%D0%B0\" title=\"\u041a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0435 \u043c\u043e\u0440\u0441\u043a\u0438\u0435 \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u044b XIX \u0432\u0435\u043a\u0430\">\u043a\u0440\u0443\u0448\u0435\u043d\u0438\u0435<\/a> \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u0430\u0431\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%92%D0%B0%D1%82%D0%B5%D1%80%D0%BB%D0%BE%D0%BE_(%D1%81%D1%83%D0%B4%D0%BD%D0%BE)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0412\u0430\u0442\u0435\u0440\u043b\u043e\u043e (\u0441\u0443\u0434\u043d\u043e) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u00ab\u0412\u0430\u0442\u0435\u0440\u043b\u043e\u043e\u00bb<\/a> ; \u043f\u043e\u0433\u0438\u0431\u043b\u043e 189 \u0447\u0435\u043b\u043e\u0432\u0435\u043a .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1850_%D0%B3%D0%BE%D0%B4\" title=\"1850 \u0433\u043e\u0434\">1850<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%B9%D0%BC%D0%B0%D1%80\" title=\"\u0412\u0435\u0439\u043c\u0430\u0440\">\u0412\u0435\u0439\u043c\u0430\u0440\u0435<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043e\u043f\u0435\u0440\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%B3%D0%BD%D0%B5%D1%80,_%D0%A0%D0%B8%D1%85%D0%B0%D1%80%D0%B4\" title=\"\u0412\u0430\u0433\u043d\u0435\u0440, \u0420\u0438\u0445\u0430\u0440\u0434\">\u0420\u0438\u0445\u0430\u0440\u0434\u0430 \u0412\u0430\u0433\u043d\u0435\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D1%8D%D0%BD%D0%B3%D1%80%D0%B8%D0%BD_(%D0%BE%D0%BF%D0%B5%D1%80%D0%B0)\" title=\"\u041b\u043e\u044d\u043d\u0433\u0440\u0438\u043d (\u043e\u043f\u0435\u0440\u0430)\">\u00ab\u041b\u043e\u044d\u043d\u0433\u0440\u0438\u043d\u00bb<\/a>. \u041e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u043b \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0443 \u0434\u0440\u0443\u0433 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%81%D1%82,_%D0%A4%D0%B5%D1%80%D0%B5%D0%BD%D1%86\" title=\"\u041b\u0438\u0441\u0442, \u0424\u0435\u0440\u0435\u043d\u0446\">\u0424\u0435\u0440\u0435\u043d\u0446 \u041b\u0438\u0441\u0442<\/a>, \u0437\u0430\u043d\u0438\u043c\u0430\u0432\u0448\u0438\u0439 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u044c \u043f\u0440\u0438\u0434\u0432\u043e\u0440\u043d\u043e\u0433\u043e \u043a\u0430\u043f\u0435\u043b\u044c\u043c\u0435\u0439\u0441\u0442\u0435\u0440\u0430, \u0442\u0430\u043a \u043a\u0430\u043a \u0441\u0430\u043c \u0412\u0430\u0433\u043d\u0435\u0440 \u0431\u044b\u043b \u0432\u044b\u043d\u0443\u0436\u0434\u0435\u043d \u043f\u043e\u043a\u0438\u043d\u0443\u0442\u044c \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044e \u043f\u043e\u0441\u043b\u0435 \u0432\u044b\u0434\u0430\u0447\u0438 \u043e\u0440\u0434\u0435\u0440\u0430 \u043d\u0430 \u0435\u0433\u043e \u0430\u0440\u0435\u0441\u0442 \u0438\u0437-\u0437\u0430 \u0443\u0447\u0430\u0441\u0442\u0438\u044f \u0432 \u0414\u0440\u0435\u0437\u0434\u0435\u043d\u0441\u043a\u043e\u043c \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0438 \u0432 \u043c\u0430\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1849_%D0%B3%D0%BE%D0%B4\" title=\"1849 \u0433\u043e\u0434\">1849 \u0433\u043e\u0434\u0430<\/a>, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u0431\u044b\u043b\u043e \u0436\u0435\u0441\u0442\u043e\u043a\u043e \u043f\u043e\u0434\u0430\u0432\u043b\u0435\u043d\u043e \u043f\u0440\u0443\u0441\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1851_%D0%B3%D0%BE%D0%B4\" title=\"1851 \u0433\u043e\u0434\">1851<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0441\u043a\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430\">\u0441\u043a\u0432\u043e\u0437\u043d\u043e\u0435 \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u043e\u0435 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u043e\u043c<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1854_%D0%B3%D0%BE%D0%B4\" title=\"1854 \u0433\u043e\u0434\">1854<\/a>&#160;\u2014 \u0412\u044b\u0445\u043e\u0434\u0438\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 \u043b\u0435\u0433\u0435\u043d\u0434\u0430\u0440\u043d\u043e\u0433\u043e \u0436\u0443\u0440\u043d\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Scientific_American\" title=\"Scientific American\">Scientific American<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1883_%D0%B3%D0%BE%D0%B4\" title=\"1883 \u0433\u043e\u0434\">1883<\/a><ul><li>\u0418\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 \u0432\u0443\u043b\u043a\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D0%BA%D0%B0%D1%82%D0%B0%D1%83\" title=\"\u041a\u0440\u0430\u043a\u0430\u0442\u0430\u0443\">\u041a\u0440\u0430\u043a\u0430\u0442\u0430\u0443<\/a>.<\/li><li>\u0412 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438 \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0420\u0430\u0431\u0441\u0442\u0432\u043e\">\u0440\u0430\u0431\u0441\u0442\u0432\u043e<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1892_%D0%B3%D0%BE%D0%B4\" title=\"1892 \u0433\u043e\u0434\">1892<\/a>&#160;\u2014 \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%81%D0%B0%D1%82%D0%B5%D0%BB%D1%8C\" title=\"\u041f\u0438\u0441\u0430\u0442\u0435\u043b\u044c\">\u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D0%BE,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%AF%D0%BA%D0%BE%D0%B2%D0%BB%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0424\u0440\u0430\u043d\u043a\u043e, \u0418\u0432\u0430\u043d \u042f\u043a\u043e\u0432\u043b\u0435\u0432\u0438\u0447\">\u0418\u0432\u0430\u043d \u0424\u0440\u0430\u043d\u043a\u043e<\/a> \u043e\u0431\u0432\u0438\u043d\u0451\u043d \u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0438\u043c\u0438 \u0432\u043b\u0430\u0441\u0442\u044f\u043c\u0438 \u0432 \u0440\u0430\u0441\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0435\u043d\u0438\u0438 \u043d\u0435\u0437\u0430\u043a\u043e\u043d\u043d\u043e\u0439 \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u044b.<\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XX_%D0%B2%D0%B5%D0%BA\" title=\"XX \u0432\u0435\u043a\">XX \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1901_%D0%B3%D0%BE%D0%B4\" title=\"1901 \u0433\u043e\u0434\">1901<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u0442\u0440\u0430\u043c\u0432\u0430\u0439\u043d\u043e\u0433\u043e \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B2%D0%B5%D1%80%D1%8C\" title=\"\u0422\u0432\u0435\u0440\u044c\">\u0422\u0432\u0435\u0440\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1904_%D0%B3%D0%BE%D0%B4\" title=\"1904 \u0433\u043e\u0434\">1904<\/a>&#160;\u2014 \u0412 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0435 \u041d\u044c\u044e\u043f\u043e\u0440\u0442 \u0430\u0432\u0442\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440\u0451\u043d \u043a \u0442\u044e\u0440\u0435\u043c\u043d\u043e\u043c\u0443 \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044e \u0437\u0430 \u043f\u0440\u0435\u0432\u044b\u0448\u0435\u043d\u0438\u0435 \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908_%D0%B3%D0%BE%D0%B4\" title=\"1908 \u0433\u043e\u0434\">1908<\/a>&#160;\u2014 \u0421\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%87%D0%B5%D0%B1%D0%BD%D1%8B%D0%B9_(%D0%B4%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C)\" title=\"\u0423\u0447\u0435\u0431\u043d\u044b\u0439 (\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c)\">\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044f \u00ab\u0423\u0447\u0435\u0431\u043d\u044b\u0439\u00bb<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910_%D0%B3%D0%BE%D0%B4\" title=\"1910 \u0433\u043e\u0434\">1910<\/a><ul><li>\u041d\u0430\u0447\u0430\u043b\u0441\u044f \u0430\u0432\u0442\u043e\u043f\u0440\u043e\u0431\u0435\u0433 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B0%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u041d\u0435\u0430\u043f\u043e\u043b\u044c\">\u041d\u0435\u0430\u043f\u043e\u043b\u044c<\/a>&#160;\u2014 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433 \u043d\u0430 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044f\u0445 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BE-%D0%91%D0%B0%D0%BB%D1%82\" title=\"\u0420\u0443\u0441\u0441\u043e-\u0411\u0430\u043b\u0442\">\u0420\u0443\u0441\u0441\u043e-\u0411\u0430\u043b\u0442<\/a>\u00bb, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u044b\u0445 \u043d\u0430 \u0440\u0438\u0436\u0441\u043a\u043e\u043c \u0420\u0443\u0441\u0441\u043a\u043e-\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u043e\u043c \u0432\u0430\u0433\u043e\u043d\u043d\u043e\u043c \u0437\u0430\u0432\u043e\u0434\u0435. \u0412\u043c\u0435\u0441\u0442\u0435 \u0441\u043e \u0441\u043f\u043e\u0440\u0442\u0441\u043c\u0435\u043d\u0430\u043c\u0438-\u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u0438\u0441\u0442\u0430\u043c\u0438 \u0435\u0445\u0430\u043b \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u044b\u0439 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%BB%D0%BB%D0%B0,_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80_%D0%9A%D0%B0%D1%80%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0443\u043b\u043b\u0430, \u0412\u0438\u043a\u0442\u043e\u0440 \u041a\u0430\u0440\u043b\u043e\u0432\u0438\u0447\">\u0412.&#160;\u041a.&#160;\u0411\u0443\u043b\u043b\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%B3%D0%BE%D1%80%D0%B8%D1%8F\" title=\"\u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u044f\">\u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u044f<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0430 \u043f\u043e\u043b\u043d\u0443\u044e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0438<\/a>, \u0442\u0435\u043f\u0435\u0440\u044c \u044d\u0442\u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0435 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0441 \u043c\u043e\u043d\u0430\u0440\u0445\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0_I_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430 I \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447\">\u041d\u0438\u043a\u043e\u043b\u0430\u0435\u043c I<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u0421\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u0441\u0432\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0446\u0435\u043f\u043f\u0435\u043b\u0438\u043d \u0441 \u043a\u0440\u0435\u0441\u0442\u043e\u043e\u0431\u0440\u0430\u0437\u043d\u044b\u043c \u0445\u0432\u043e\u0441\u0442\u043e\u043c, \u00abLZ-27\u00bb. \u0412\u044b\u043f\u043e\u043b\u043d\u0438\u0432 \u043e\u043a\u043e\u043b\u043e 50 \u043f\u043e\u043b\u0451\u0442\u043e\u0432, \u043e\u043d \u0440\u0430\u0437\u0431\u0438\u043b\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916_%D0%B3%D0%BE%D0%B4\" title=\"1916 \u0433\u043e\u0434\">1916 \u0433\u043e\u0434\u0443<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0432\u044b\u043d\u0443\u0436\u0434\u0435\u043d\u043d\u043e\u0439 \u043f\u043e\u0441\u0430\u0434\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u041f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0430 \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0435\u0440\u0435\u043f\u0438\u0441\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a>&#160;\u2014 \u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0430\u044f \u043f\u043e\u043b\u0438\u0446\u0438\u044f \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0430 \u0440\u0430\u0434\u0438\u043e \u0434\u043b\u044f \u043f\u043e\u0438\u043c\u043a\u0438 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043d\u0438\u043a\u0430. \u041f\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8-%D0%B1%D0%B8-%D1%81%D0%B8\" title=\"\u0411\u0438-\u0431\u0438-\u0441\u0438\">\u0411\u0438-\u0411\u0438-\u0421\u0438<\/a>\u00bb \u0431\u044b\u043b\u0438 \u043f\u0435\u0440\u0435\u0434\u0430\u043d\u044b \u043f\u0440\u0438\u043c\u0435\u0442\u044b \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043d\u0438\u043a\u0430, \u043f\u043e\u0434\u043e\u0437\u0440\u0435\u0432\u0430\u0435\u043c\u043e\u0433\u043e \u0432 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1936_%D0%B3%D0%BE%D0%B4\" title=\"1936 \u0433\u043e\u0434\">1936<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%86%D0%B0_(%D0%B0%D0%B2%D1%82%D0%BE%D0%B4%D1%80%D0%BE%D0%BC)\" title=\"\u041c\u043e\u043d\u0446\u0430 (\u0430\u0432\u0442\u043e\u0434\u0440\u043e\u043c)\">\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0430\u0432\u0442\u043e\u0434\u0440\u043e\u043c<\/a>. \u0413\u043e\u043d\u043e\u0447\u043d\u0430\u044f \u0442\u0440\u0430\u0441\u0441\u0430, \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u0430\u044f \u0440\u044f\u0434\u043e\u043c \u0441 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u043c \u043f\u0430\u0440\u043a\u043e\u043c \u00ab\u041c\u043e\u043d\u0446\u0430\u00bb, \u0443\u0436\u0435 \u0434\u0430\u0432\u043d\u043e \u0441\u0442\u0430\u043b\u0430 \u043b\u0435\u0433\u0435\u043d\u0434\u0430\u0440\u043d\u043e\u0439. \u041e\u043d\u0430 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0440\u0430\u0437 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u0430\u0438\u0432\u0430\u043b\u0430\u0441\u044c, \u043f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u043e (\u0437\u0430 \u0438\u0441\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435\u043c \u043e\u0434\u043d\u043e\u0433\u043e \u0433\u043e\u0434\u0430) \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043c\u0435\u0441\u0442\u043e\u043c \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0413\u0440\u0430\u043d-\u043f\u0440\u0438 \u0418\u0442\u0430\u043b\u0438\u0438 \u0432 \u0433\u043e\u043d\u043a\u0430\u0445 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D1%80%D0%BC%D1%83%D0%BB%D0%B0-1\" title=\"\u0424\u043e\u0440\u043c\u0443\u043b\u0430-1\">\u0424\u043e\u0440\u043c\u0443\u043b\u044b-1<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u041e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\u043d\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Toyota\" title=\"Toyota\">\u0422\u043e\u0439\u043e\u0442\u0430<\/a>\u00bb. \u041e\u0442\u0446\u043e\u043c-\u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u0435\u043c \u0441\u0442\u0430\u043b \u041a\u0438\u0438\u0447\u0438\u0440\u043e \u0422\u043e\u0439\u043e\u0434\u0430 (Kiichir\u014d Toyoda).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 \u0412 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%82%D1%82%D0%B8%D0%BD%D0%B3%D0%B5%D0%BC\" title=\"\u041d\u043e\u0442\u0442\u0438\u043d\u0433\u0435\u043c\">\u041d\u043e\u0442\u0442\u0438\u043d\u0433\u0435\u043c<\/a> \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0441\u044f \u043a\u0440\u0443\u043f\u043d\u044b\u0439 \u0448\u0430\u0445\u043c\u0430\u0442\u043d\u044b\u0439 \u0442\u0443\u0440\u043d\u0438\u0440, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u0438\u043d\u044f\u043b\u0438 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 \u0441\u0438\u043b\u044c\u043d\u0435\u0439\u0448\u0438\u0435 \u0448\u0430\u0445\u043c\u0430\u0442\u0438\u0441\u0442\u044b \u043c\u0438\u0440\u0430, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0447\u0435\u0442\u044b\u0440\u0451\u0445 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u043e\u0432 \u043c\u0438\u0440\u0430&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%81%D0%BA%D0%B5%D1%80,_%D0%AD%D0%BC%D0%B0%D0%BD%D1%83%D1%8D%D0%BB%D1%8C\" title=\"\u041b\u0430\u0441\u043a\u0435\u0440, \u042d\u043c\u0430\u043d\u0443\u044d\u043b\u044c\">\u042d. \u041b\u0430\u0441\u043a\u0435\u0440\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BF%D0%B0%D0%B1%D0%BB%D0%B0%D0%BD%D0%BA%D0%B0,_%D0%A5%D0%BE%D1%81%D0%B5_%D0%A0%D0%B0%D1%83%D0%BB%D1%8C\" title=\"\u041a\u0430\u043f\u0430\u0431\u043b\u0430\u043d\u043a\u0430, \u0425\u043e\u0441\u0435 \u0420\u0430\u0443\u043b\u044c\">\u0425.-\u0420. \u041a\u0430\u043f\u0430\u0431\u043b\u0430\u043d\u043a\u0443<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D1%85%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0410\u043b\u0435\u0445\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u0410. \u0410\u043b\u0435\u0445\u0438\u043d\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B9%D0%B2%D0%B5,_%D0%9C%D0%B0%D0%BA%D1%81\" title=\"\u042d\u0439\u0432\u0435, \u041c\u0430\u043a\u0441\">\u041c. \u042d\u0439\u0432\u0435<\/a>. \u0412\u043c\u0435\u0441\u0442\u0435 \u0441 \u041a\u0430\u043f\u0430\u0431\u043b\u0430\u043d\u043a\u043e\u0439 \u043f\u043e\u0431\u0435\u0434\u0443 \u0432 \u0442\u0443\u0440\u043d\u0438\u0440\u0435 \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u043b \u043c\u043e\u043b\u043e\u0434\u043e\u0439 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u0448\u0430\u0445\u043c\u0430\u0442\u0438\u0441\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%82%D0%B2%D0%B8%D0%BD%D0%BD%D0%B8%D0%BA,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9C%D0%BE%D0%B8%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0411\u043e\u0442\u0432\u0438\u043d\u043d\u0438\u043a, \u041c\u0438\u0445\u0430\u0438\u043b \u041c\u043e\u0438\u0441\u0435\u0435\u0432\u0438\u0447\">\u041c\u0438\u0445\u0430\u0438\u043b \u0411\u043e\u0442\u0432\u0438\u043d\u043d\u0438\u043a<\/a>. \u041d\u0430 \u0440\u043e\u0434\u0438\u043d\u0435 \u043e\u043d \u0431\u044b\u043b \u043d\u0430\u0433\u0440\u0430\u0436\u0434\u0451\u043d \u043e\u0440\u0434\u0435\u043d\u043e\u043c \u00ab\u0417\u043d\u0430\u043a \u041f\u043e\u0447\u0451\u0442\u0430\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442 \u0423\u043a\u0430\u0437 \u041f\u0440\u0435\u0437\u0438\u0434\u0438\u0443\u043c\u0430 \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0421\u043e\u0432\u0435\u0442\u0430 \u0421\u0421\u0421\u0420, \u043f\u043e\u043b\u043e\u0436\u0438\u0432\u0448\u0438\u0439 \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BF%D0%BE%D1%80%D1%82%D0%B0%D1%86%D0%B8%D1%8F_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BE%D0%B2_%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0414\u0435\u043f\u043e\u0440\u0442\u0430\u0446\u0438\u044f \u043d\u0430\u0440\u043e\u0434\u043e\u0432 \u0432 \u0421\u0421\u0421\u0420\">\u0434\u0435\u043f\u043e\u0440\u0442\u0430\u0446\u0438\u0438<\/a> \u043d\u0435\u043c\u0446\u0435\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B2%D0%BE%D0%BB%D0%B6%D1%8C%D0%B5\" title=\"\u041f\u043e\u0432\u043e\u043b\u0436\u044c\u0435\">\u041f\u043e\u0432\u043e\u043b\u0436\u044c\u044f<\/a> \u043d\u0430 \u0441\u043f\u0435\u0446\u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0438\u0435 \u0432 \u0421\u0438\u0431\u0438\u0440\u044c \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d\">\u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u043d\u0430\u043b\u043e\u0436\u0438\u043b\u0438 \u0432\u0435\u0442\u043e \u043d\u0430 \u0432\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041d\u0430\u0446\u0438\u0439\">\u041e\u041e\u041d<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB%D0%B8%D1%8F\" title=\"\u041c\u043e\u043d\u0433\u043e\u043b\u0438\u044f\">\u041c\u043e\u043d\u0433\u043e\u043b\u0438\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B1%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0410\u043b\u0431\u0430\u043d\u0438\u044f\">\u0410\u043b\u0431\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/